import React from "react";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <nav className="m-6 mt-20 bg-slate-700 w-fit content-center flex">
      <ul className="text-2xl flex flex-col gap-10 cursor-pointer">
        <Link to={"/"}>
          <li className="fa-solid fa-house"></li>
        </Link>

        <li className="fa-solid fa-book"></li>
        <li className="fa-solid fa-laptop-file"></li>
        <li className="fa-solid fa-headset"></li>
        <li className="fa-solid fa-bars-progress"></li>
      </ul>
    </nav>
  );
};

export default NavBar;
